import React from 'react';
import './styles/auth-button.css';
import { $jsf } from '../JSF';
import { LocalDB } from './scripts/AuthLocal';
import { DB } from './scripts/AuthDB';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';

class AuthButton extends React.Component {

    inputs = {};

	constructor(props) {
		super(props);
	}

    componentDidMount() {
        this.inputs['name'] = $jsf(`#username`);
        this.inputs['password'] = $jsf(`#password`);
        this.inputs['email'] = $jsf(`#email`);
        this.inputs['phone'] = $jsf(`#phone`);
    }

	render() { 
		return <section className='authorization-confirm'>
            <Link to="./AboutUs">{this.props.showRegFields ? 'CREATE ACCOUNT' : 'CONTINUE'}</Link>
        </section>
	}
}
export { AuthButton };
